-- create database schema
CREATE DATABASE womens_health
    WITH 
    OWNER = postgres
    ENCODING = 'UTF8'
    CONNECTION LIMIT = -1;
    
-- create table cities - containing information on the city level of each state
CREATE TABLE cities (
	id SERIAL PRIMARY KEY,
  	city VARCHAR(128) NOT NULL,
	state VARCHAR(128) NOT NULL,
	population INT NOT NULL,
	latitude REAL NOT NULL,
	longititue REAL NOT NULL,
	gestation_8_duration INT NOT NULL,
	gestation_8_duration_closed INT NOT NULL,
	gestation_12_duration INT NOT NULL,
	gestation_12_duration_closed INT NOT NULL,
	gestation_16_duration INT NOT NULL,
	gestation_16_duration_closed INT NOT NULL,
	gestation_20_duration INT NOT NULL,
	gestation_20_duration_closed INT NOT NULL
);

-- create table healthcare_date - containing abortion rates and clincs in each state
CREATE TABLE healthcare_data (
	id SERIAL PRIMARY KEY,
	state VARCHAR(128) NOT NULL,
	percent_change_abortion_rate_state_occurence REAL NOT NULL,
	percent_change_number_of_clinics REAL NOT NULL,
	percent_change_us_abortions_state_occurence REAL NOT NULL,
	percent_counties_without_clinic REAL NOT NULL,
	percent_women_living_counties_without_clinics REAL NOT NULL,
	abortion_rate_state_occurence_2014 REAL NOT NULL,
	abortion_rate_state_residence_2014 REAL NOT NULL,
	change_number_of_clinics INT NOT NULL,
	number_abortions_state_occurence_2014 INT NOT NULL,
	number_abortions_state_residence_2014 INT NOT NULL,
	numer_clinics_2014 INT NOT NULL
);

